def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    result = []
    split_dash = input1.split('-')
    for i, part in enumerate(split_dash):
        if i > 0:
            result.append(part.capitalize())
        else:
            result.append(part)
    return "".join(result)
